import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      string: "NEGAIVE THOUGHT ELIMINATOR",
    }

  }
  render() {
      return (
        <div className="App">
          <header className="App-header">
            <p>{this.state.string}</p>
            <p>{this.state.string}</p>
            <button>DELETE</button>
          </header>
        </div>
      )
    }
}

export default App;
